using namespace std;

int hash_key(int i , int j , int weight){
    return (i + 1) * weight + j; 
}

bool checkSubarraySum(vector<int>& nums, int k) {
    if(nums.empty() || nums.size() <= 1){
        return false;
    }

    const int size = nums.size();
    //cout << "size = " << size << endl;
    //int data[size][size];
    map<int , int> data;


    for(int i = 0 ; i < size ;i++){
        //data[i +"_" + i] = nums[i];
        data[hash_key(i , i , size)] = nums[i];
    }//end for i

    for(int i = 0; i < nums.size(); i++){
        for(int j = i + 1;j < nums.size() ; j++){
            //data[i][j] = data[i][j - 1] + nums[j];
            //cout << "check i = " << i << " j = " << j << endl;
            int subSumResult = data[hash_key(i , (j - 1) , size)] + nums[j];
            
            data[hash_key(i , j , size)] = subSumResult;
           
            if(subSumResult % k == 0){
                cout << "find result from " << i << " to " << j << endl;
                return true;
            }
        }
    }//end for i

    //show matrix
    // for(int i = 0 ; i < size ;i++){
    //     for(int j = 0 ; j < size ; j++){
    //         cout << "\t " << data[i][j] << " ";
    //     }//end for j
    //     cout << endl;
    // }//end for i

    return false;
}

